import * as types from "../types";
const initialState = {
    weather: null,
};



const generalReducer = (state = initialState, action) => {
  switch (action.type) {
   
      case types.GET_WEATHER:
       
        return{
          ...state,
          enemy: action.payload,
          
        }
        
    default:
      return state;
  }
};

export default generalReducer;
